import React from 'react';
import Typography from '@material-ui/core/Typography';
import RenderDateSelect from './RenderDateSelect';

const DateRange = () => {
	return (
		<div>
			<RenderDateSelect 
				dateLegend='Start date'
				dateParam='sdate'
			/>
			<Typography className={classes.filterLabel}>
				 -
			</Typography>
			<RenderDateSelect 
				dateLegend='End date'
				dateParam='edate'
			/>
		</div>
	)
}

export default DateRange;
